def draw_poly(downflag,iid,fill_flag,fc,pc,pz,points,scale=2):
    '''根据参数画多边形,downflag落笔标志
      iid: 编号,没有则是空, fill_flag:填充标志, fc:填充颜色,
      pc:画笔颜色,pz:画笔线宽,points_坐标序列'''
    global counter
    turtle.pencolor(pc)
    turtle.pensize(pz)
    turtle.penup()
    x ,y = points[0]
    frames.append(screen.save())
    turtle.goto(scale*x,scale*y)
    frames.append(screen.save())
    if downflag:turtle.pendown()  # 如果落笔标志为真,则落笔
    if fill_flag:
        turtle.fillcolor(fc)
        turtle.begin_fill()
    for x,y in points[1:]:
        turtle.goto(scale*x,scale*y)
        counter += 1
        #if counter % 20 ==0: frames.append(screen.save())
    if fill_flag:
        turtle.end_fill()
    turtle.penup()

