def 自制(character,font=None):
    if font == None:
        def character1(font="larry3d"):
            f = Figlet(font=font)
            print(f.renderText(character))

        character1()

    else:
        def characters(font=font):
            f = Figlet(font=font)
            print(f.renderText(character))

        characters()

def 颜色字体(txt,color = None):
    if color == 'red':
        result = f"\033[31m{txt}\033[0m"

    elif color == 'green':
        result = f"\033[32m{txt}\033[0m"

    elif color == 'yellow':
        result = f"\033[33m{txt}\033[0m"

    elif color == 'blue':
        result = f"\033[34m{txt}\033[0m"

    elif color == 'violet':
        result = f"\033[35m{txt}\033[0m"

    elif color == 'cyan':
        result = f"\033[36m{txt}\033[0m"

    elif color == 'gray':
        result = f"\033[37m{txt}\033[0m"

    elif color == 'black':
        result = f"\033[30m{txt}\033[0m"

    else:
        result = txt

    return result

